"tip_tips" : "Users can set up an extra tip when they transfer money to improve the priority of the transaction and make it complete more quickly.
(1) Tipping is optional. Users can choose whether to tip or not according to the actual scenario;
(2) Under the same circumstances, the trade fair that paid the tip was packed by the miners first."

"tip_tips" : "Los usuarios pueden configurar una propina adicional cuando transfieran dinero para aumentar la prioridad de esta transacción y hacer que la transacción se complete más rápido.
(1) la propina es opcional y el usuario puede elegir si desea o no pagar propina en función del escenario real;
(2) en las mismas circunstancias, las transacciones que han pagado propinas son empacadas preferentemente por los mineros."

"tip_tips" : "Người dùng có thể đặt một mẹo bổ sung khi chuyển tiền để nâng cao ưu tiên của giao dịch này và làm cho giao dịch nhanh hơn.
(1) lời khuyên là tùy chọn, người dùng có thể chọn để trả lời lời khuyên dựa trên thực tế;
(2) trong cùng một trường hợp, hội chợ được người thợ mỏ ưu tiên đóng gói."

"tip_tips" : "Quando si effettua un bonifico, l’utente può mettere a disposizione una manina supplementare per aumentare la priorità di tale operazione e per accelerare il suo completamento.
(1) la discarica è facoltativa e l’utente può scegliere se pagarla in base allo scenario reale;
(2) nelle stesse circostanze, le fiere in cui è stata pagata la mancia sono state imballate in via prioritaria dai minatori."

